// Footer component to display contact information and the year of the website's creation and ownership details
import React from 'react';

const Footer = () => {
    return (
        // Footer component with contact information and ownership details
        <footer>
            <p>Contact us at: <a href="mailto:infotrafiri@gmail.com">info@trafiri.com</a></p>
            <p>&copy; 2024 Trafiri. All rights reserved.</p>
        </footer>
    );
}

export default Footer;
